import React from 'react';


class PersonList extends React.Component {
        state = {
            results: []
        }

    componentDidMount() {

    }

    render() {
        return (
            <tbody>
                { this.state.results.map(person => {
                   return <tr>
                        <td>{person.first}</td>
                        <td>{person.last}</td>
                        <td>{person.email}</td>
                        <td>{person.phone}</td>
                        <td>{person.id}</td>
                    </tr>
                })}
            </tbody>
        )
    }
}
export default PersonList
